qt[2005] = {
  id = 2005,
  name = "[ \u80DC\u8D1F\u7684\u5173\u952E ]",
  contents = {
    "\u600E, \u600E\u4E48\u53EF\u80FD!",
    "ANSWER_YES:\u8BE5\u4E0D\u4F1A\u6211\u4EEC\u53C8\u8F93\u4E86\u5427?",
    "\u8FD9\u6B21\u662F\u5E73\u5C40. \u6211\u4EEC\u91CD\u89C6\u7684\u662F\u7D2B\u83DC\u7684\u5473\u9053\uFF0C\u76F8\u53CD\u90AA\u6D3E\u91CD\u89C6\u7684\u597D\u50CF\u662F\u5BFF\u53F8\u6750\u6599. \u56E0\u6B64\u80DC\u8D1F\u7684\u5173\u952E\u53D6\u51B3\u4E8E\u5404\u6D3E\u7CFB\u6B66\u58EB\u4EEC\u7684\u559C\u597D\u4E86.",
    "ANSWER_YES:\u8BE5\u4E0D\u4F1A\u5BFF\u53F8\u6D88\u8017\u66F4\u591A\u7684\u6D3E\u7CFB\u2026",
    "\u6CA1\u9519! \u5728\u4E00\u5B9A\u65F6\u95F4\u5185\u6D88\u8017\u66F4\u591A\u5BFF\u53F8\u7684\u6D3E\u7CFB\u5C06\u83B7\u80DC! \u77E5\u9053\u4E86\u5417? \u9A6C\u4E0A\u53BB\u6536\u96C6\u7D2B\u83DC\u56DE\u6765! \u7136\u540E\u4F7F\u52B2\u5403! \u60F3\u4EC0\u4E48\u5462! \u71D5\u4E16\u5B50\u4F60\u4E5F\u5FEB\u70B9\u53BB\u6536\u96C6\u7D2B\u83DC\u5440!",
    "ANSWER_YES:(\u71D5\u4E16\u5B50\u5413\u4E86\u4E00\u8DF3\uFF0C\u6025\u6025\u5FD9\u5FD9\u62FF\u8D77\u5200\u8D70\u4E86\u51FA\u53BB.)",
    "\u6B63\u6D3E\u6210\u5458\u53EF\u4EE5\u5728\u767D\u65A9\u59EC\u90A3\u91CC\u752810\u4E2A\u7D2B\u83DC\u4EA4\u63621\u4E2A\u6B63\u6D3E\u5BFF\u53F8. \u73B0\u5728\u8FD8\u6CA1\u51FA\u53D1\u4E48?"
