qt[2006] = {
  id = 2006,
  name = "[ \u77E5\u5DF1\u77E5\u5F7C \u767E\u6218\u767E\u80DC! ]",
  contents = {
    "\u54C8\u54C8\u54C8\u54C8! \u53C8\u8FCE\u6765\u4E86\u75DB\u5FEB\u7684\u65F6\u8282!",
    "ANSWER_YES:\u6709\u4EC0\u4E48\u597D\u4E8B\u513F\u4E48?",
    "\u5F53\u7136\u6709\u4E86. \u6BCF\u5E74\u79CB\u5B63\u90FD\u4F1A\u4EE5\u6B66\u6797\u76DF\u4E3A\u4E2D\u5FC3\u5C55\u5F00\u6B63\u6D3E\u548C\u90AA\u6D3E\u7684\u8FD0\u52A8\u4F1A. \u53BB\u5E74\u6211\u4EEC\u90AA\u6D3E\u4EE5\u9886\u5148\u7684\u5206\u6570\u8D62\u5F97\u4E86\u6BD4\u8D5B\uFF0C\u6709\u5E78\u770B\u5230\u4E86\u767D\u65A9\u59EC\u6124\u6012\u7684\u8868\u60C5.",
    "ANSWER_YES:\u55EF, \u8FD9\u6B21\u4E5F\u80FD\u8F7B\u677E\u53D6\u80DC\u4E48?",
    "\u90A3\u5F53\u7136\u4E86! \u5BFF\u53F8\u5BF9\u51B3\u4E2D\u6211\u4EEC\u90AA\u6D3E\u6709\u6E05\u6C5F\u6751\u53A8\u5E08\uFF0C\u80DC\u5229\u5BF9\u6211\u4EEC\u6765\u8BF4\u5F53\u7136\u8F7B\u800C\u6613\u4E3E!",
    "ANSWER_YES:(\u6B64\u65F6\u82B1\u8138\u5973\u9012\u8FC7\u7EB8\u6761. \u7EB8\u6761\u4E0A\u5199\u7740\u6B63\u6D3E\u8058\u8BF7\u97E9\u91CE\u53A8\u623F\u957F.)",
    "\u4EC0\u4E48? \u4E0D\uFF0C\u4E0D\u80FD\u5750\u4EE5\u5F85\u6BD9! \u4F60\u53BB\u6E05\u6C5F\u6751\u4E1C\u8FB9\u770B\u770B\u6E05\u6C5F\u6751\u53A8\u5E08\u51C6\u5907\u7684\u600E\u4E48\u6837\u4E86. \u8FD8\u6709\u5631\u5490\u4ED6\u6B63\u6D3E\u548C\u4E4B\u524D\u4E0D\u4E00\u6837\u4E86\uFF0C\u4E0D\u80FD\u6389\u4EE5\u8F7B\u5FC3."
  },
  answer = {
