    "ANSWER_YES:\u6CA1, \u6CA1\u9519\u2026",
    "\u6211\u4E0D\u80FD\u8FD9\u6837\u773C\u7741\u7741\u770B\u7740\u6B63\u6D3E\u80DC\u5229! \u521A\u5DE7\u97E9\u91CE\u6751\u5357\u8FB9\u6709\u4E00\u4E2A\u53EF\u7591\u7684\u4E5E\u4E10. \u4F60\u53BB\u627E\u4ED6. \u5176\u5B9E\u4ED6\u662F\u6211\u7684\u5E08\u5144. \u4ED6\u80FD\u505A\u51FA\u4E0E\u6B63\u6D3E\u6C34\u5E73\u76F8\u5F53\u7684\u5BFF\u53F8!"
