qt[2008] = {
  id = 2008,
  name = "[ \u8BA4\u597D\u4E1C\u897F ]",
  contents = {
    "\u54B3\u54B3\uFF0C\u4F60\u662F\u8C01\u5440? \u597D\u719F\u6089\u7684\u6C14\u5473. \u4E0D\u5BF9\u2026\u597D\u50CF\u662F\u6211\u8EAB\u4E0A\u7684\u5473\u513F?",
    "ANSWER_YES:\u60A8\u662F\u6E05\u6C5F\u6751\u53A8\u5E08\u7684\u5E08\u5144\u5427?",
    "\u6CA1\u9519. \u90A3\u4E2A\u5149\u5934\u732A\u8BA9\u4F60\u6765\u627E\u6211\u7684? \u4EC0\u4E48\u4E8B\u513F? \u6563\u53D1\u7740\u53EF\u7591\u7684\u5473\u9053. \u4E0D\u5BF9\u2026\u597D\u50CF\u662F\u6211\u8EAB\u4E0A\u7684\u5473\u513F?",
    "ANSWER_YES:\u60F3\u8BA9\u60A8\u5E2E\u52A9\u90AA\u6D3E\u505A\u5BFF\u53F8. \u5F53\u7136\u8BF7\u60A8\u5148\u6D17\u4E00\u4E0B.",
    "\u5BFF\u53F8? \u597D\u6000\u5FF5\u7684\u5473\u9053. \u4E0D\u5BF9\u2026\u597D\u50CF\u662F\u6211\u8EAB\u4E0A\u7684\u5473\u513F?",
    "ANSWER_YES:\u60C5\u51B5\u7D27\u6025\uFF0C\u8BF7\u60A8\u52A1\u5FC5\u7B54\u5E94. \u5426\u5219\u5C06\u6B66\u529B\u2026",
    "\u6211\u6765\u505A! \u53EA\u4E0D\u8FC7\uFF0C\u6709\u4E8B\u60C5\u9700\u8981\u4F60\u5E2E\u5FD9!",
    "ANSWER_YES:\u4EC0\u4E48\u4E8B\u513F?",
    "\u6211\u53D8\u6210\u73B0\u5728\u8FD9\u526F\u4E5E\u4E10\u6837\u5B50\u5230\u5904\u6E38\u8361\u7684\u539F\u56E0\u4E4B\u4E00\u662F\u56E0\u4E3A\u98DF\u6750\u88AB\u602A\u7269\u4EEC\u5077\u53BB\u4E86. \u8FD9\u4E9B\u98DF\u6750\u662F\u975E\u5E38\u68D2\u7684\u5BFF\u53F8\u6750\u6599. \u77E5\u9053\u4F60\u5E94\u8BE5\u600E\u4E48\u505A\u4E86\u4E48?",
    "ANSWER_YES:\u968F\u4FBF\u51FB\u9000\u54EA\u79CD\u602A\u7269\u4E48?",
    "\u662F\u7684. \u5404\u79CD\u5404\u6837\u7684\u602A\u7269\u90FD\u6765\u5077\u8FC7. \u6700\u597D\u51FB\u9000\u548C\u4F60\u7684\u529F\u529B\u76F8\u5F53\u7684\u602A\u7269\uFF0C\u5F53\u7136\u4E5F\u53EF\u4EE5\u968F\u4FBF\u51FB\u9000\u54EA\u79CD\u602A\u7269\u6536\u96C610\u4E2A\u5BFF\u53F8\u6750\u6599! \u5149\u60F3\u60F3\u5C31\u80FD\u95FB\u5230\u9999\u5473.\u4E0D\u5BF9\u2026\u597D\u50CF\u662F\u6211\u8EAB\u4E0A\u7684\u5473\u513F?"
  },
  answer = {
    "\u77E5\u9053\u4E86. \u9A6C\u4E0A\u5C31\u53BB\u6536\u96C610\u4E2A\u5BFF\u53F8\u6750\u6599.",
    "\u4E0D\u53BB, \u65E0\u6CD5\u76F8\u4FE1. \u60A8\u8FD8\u662F\u4EB2\u81EA\u53BB\u6536\u96C6\u5427?"
