qt[2010] = {
  id = 2010,
  name = "[ \u80DC\u8D1F\u7684\u5173\u952E ]",
  contents = {
    "\u5F88\u9057\u61BE\u8FD9\u6B21\u662F\u5E73\u5C40. \u6B63\u6D3E\u8058\u8BF7\u7684\u97E9\u91CE\u53A8\u623F\u957F\u679C\u7136\u4E0D\u662F\u666E\u901A\u4EBA.",
    "ANSWER_YES:\u90A3\u4E48\u5C31\u8FD9\u6837\u7ED3\u675F\u4E86\u4E48?",
    "\u5F53\u7136\u6CA1\u6709! \u73B0\u5728\u624D\u521A\u521A\u5F00\u59CB! \u542C\u9F99\u6797\u6D3E\u5E08\u5144\u8BF4\uFF0C\u5404\u6D3E\u7CFB\u7684\u6B66\u58EB\u4EEC\u66F4\u52A0\u652F\u6301\u8C01\u7684\u5BFF\u53F8\u8C01\u5C31\u8D62.",
    "ANSWER_YES:\u5177\u4F53\u4EC0\u4E48\u5185\u5BB9\u5462?",
    "\u4ECE\u73B0\u5728\u5F00\u59CB\u6536\u96C610\u4E2A\u5BFF\u53F8\u6750\u6599\u5C31\u53EF\u4EE5\u4EA4\u63621\u4E2A\u90AA\u6D3E\u5BFF\u53F8. \u4EE5\u8FD9\u79CD\u5F62\u5F0F\u5728\u4E00\u5B9A\u65F6\u95F4\u5185\u54EA\u4E2A\u6D3E\u7CFB\u7684\u5BFF\u53F8\u6D88\u8017\u7684\u66F4\u591A\uFF0C\u54EA\u4E2A\u6D3E\u7CFB\u83B7\u5F97\u80DC\u5229.",
    "ANSWER_YES:\u54E6! \u8FD9\u6837\u7684\u8BDD\u53EF\u4E0D\u80FD\u8F93!",
    "\u6CA1\u9519! \u5728\u5403\u7684\u5BF9\u51B3\u4E2D\u6211\u4EEC\u53EF\u4E0D\u4F1A\u8F93\u7ED9\u6B63\u6D3E\u7684\u4E66\u751F\u4EEC! \u5FEB\u53BB\u6536\u96C610\u4E2A\u5BFF\u53F8\u6750\u6599. \u7136\u540E\u6240\u6709\u4EBA\u540C\u5FC3\u534F\u529B\u5403\u90AA\u6D3E\u5BFF\u53F8\u5427. \u9996\u5148\u4ECE\u6211\u5F00\u59CB! \u554A\u545C\u554A\u545C."
  },
  answer = {
