    "\u9B3C\u8C37\u6751\u957F\u5728\u5982\u6B64\u8D2B\u56F0\u7684\u60C5\u5F62\u4E0B\u8FD8\u7ED9\u5404\u6751\u9001\u6765\u4E86\u7CD6\u679C\uFF0C\u7ED3\u679C\u7CD6\u679C\u5168\u88AB\u602A\u7269\u4EEC\u5077\u8D70\u4E86\uFF01",
    "ANSWER_YES:\u5929\u554A\uFF01\u90A3\u9B3C\u8C37\u6751\u957F\u5F97\u591A\u4F24\u5FC3\u554A\uFF01",
    "\u662F\u554A\uFF0C\u54B1\u4EEC\u6E05\u9634\u5173\u7684\u5C0F\u670B\u53CB\u4EEC\u4E00\u6837\u5F88\u4F24\u5FC3\u554A\uFF01\u6211\u4EEC\u5BB6\u90A3\u5B69\u5B50\u542C\u95FB\u540E\u7ACB\u9A6C\u5C31\u95F7\u95F7\u4E0D\u4E50\u4E86\u3002\u6240\u4EE5...\u5C11\u4FA0\u60A8\u80FD\u4E0D\u80FD\u5E2E\u5E2E\u6211\u4EEC\uFF1F",
    "ANSWER_YES:\u6211\u53EF\u4EE5\u505A\u4E9B\u4EC0\u4E48\u5462\uFF1F",
    "\u51FB\u9000\u8DDF\u5C11\u4FA0\u60A8\u7B49\u7EA7\u76F8\u8FD1\u7684\u602A\u7269\uFF0C\u5C31\u80FD\u83B7\u5F97\u84DD\u8272\u68D2\u68D2\u7CD6\u548C\u7EA2\u8272\u68D2\u68D2\u7CD6\uFF0C\u8BF7\u5E2E\u6211\u4EEC\u5404\u6536\u96C615\u4E2A\u56DE\u6765\u5427\uFF01"
