qt[2058] = {
  id = 2058,
  name = "[ \u519B\u58EB - \u5170\u9709\u5320\u7684\u6D88\u606F ]",
  contents = {
    "\u4F60\u53BB\u9009\u62E9\u6D3E\u7CFB\u7684\u65F6\u5019\u60C5\u62A5\u7F51\u4F20\u6765\u6D88\u606F\u8BF4\uFF0C\u5170\u9709\u5320\u5F00\u59CB\u884C\u52A8\u4E86\u3002\u5176\u5B9E\u4E4B\u524D\u662F\u6211\u4EEC\u4E0D\u77E5\u9053\u800C\u5DF2\uFF0C\u636E\u8BF4\u5DF2\u7ECF\u884C\u52A8\u6709\u6BB5\u65F6\u95F4\u4E86",
    "ANSWER_YES:\u4EC0\u4E48\u4E8B\u554A\uFF1F",
    "\u5170\u9709\u5320\u7684\u90E8\u961F\u6B63\u9886\u7740\u80FD\u5728\u7A7A\u4E2D\u98DE\u884C\u7684\u5947\u602A\u7684\u57CE\u653B\u51FB\u5357\u8FB9\u7684\u97E9\u91CE\u57CE\u3002\u542C\u8BF4\u97E9\u91CE\u57CE\u662F\u51AC\u6DF7\u6C64\u7684\u540E\u4EE3\u5EFA\u7ACB\u7684\u57CE\u5E02",
    "ANSWER_YES:\u90A3\u5170\u9709\u5320\u4E5F\u4F1A\u51FA\u73B0\u5427\uFF1F",
    "\u4E0D\u662F\uFF0C\u597D\u50CF\u6CA1\u6709\u4EB2\u81EA\u51FA\u73B0\u3002\u5982\u679C\u51FA\u73B0\u7684\u8BDD\u4EE5\u97E9\u91CE\u57CE\u7684\u519B\u961F\u5B9E\u529B\u662F\u7EDD\u5BF9\u4E0D\u80FD\u62B5\u6321\u7684\u3002\u51FA\u73B0\u7684\u5E94\u8BE5\u90FD\u662F\u624B\u4E0B\uFF0C\u97E9\u91CE\u57CE\u624D\u80FD\u575A\u5B88\u5230\u73B0\u5728",
    "ANSWER_YES:\u771F\u662F\u4E07\u5E78\u554A~",
    "\u73B0\u5728\u5B89\u5FC3\u8FD8\u592A\u65E9\u4E86\u3002\u4EB2\u81EA\u9A7E\u4E34\u7684\u8BDD\u9A6C\u4E0A\u5C31\u80FD\u89E3\u51B3\u7684\u4E8B\u60C5\uFF0C\u770B\u4ED6\u6CA1\u6709\u81EA\u5DF1\u51FA\u73B0\u80AF\u5B9A\u6709\u5176\u4ED6\u539F\u56E0~\u4F60\u53BB\u5E2E\u52A9\u97E9\u91CE\u57CE\u7684\u519B\u961F\u4E5F\u6CA1\u5173\u7CFB\uFF0C\u4F46\u662F\u4E00\u5B9A\u8981\u5C0F\u5FC3\uFF01",
    "ANSWER_YES:\u5982\u679C\u53BB\u7684\u8BDD\uFF0C\u6211\u4F1A\u5C0F\u5FC3\u7684",
    "\u90A3\u8FB9\u7684\u4E8B\u6682\u65F6\u522B\u7BA1\uFF0C\u5148\u89E3\u51B3\u71C3\u7709\u4E4B\u6025\u518D\u8BF4\u3002\u8425\u5730\u91CC\u7684\u7ED3\u754C\u53D1\u73B0\u4E86\u95EE\u9898\uFF0C\u7A7A\u4E2D\u6709\u4E2A\u6D1E\u3002\u7AF9\u6797\u7684\u98DE\u5934\u9B3C\u901A\u8FC7\u90A3\u4E2A\u6D1E\u88AD\u51FB\u4E86\u8425\u5730",
    "ANSWER_YES:\u8FD9\uFF01",
    "\u73B0\u5728\u52A0\u5F3A\u7ED3\u754C\u5462\uFF0C\u4E0D\u8FC7[\u98DE\u5934\u9B3C]\u603B\u662F\u901A\u8FC7\u90A3\u4E2A\u6D1E\u6324\u8FDB\u6765\uFF0C\u6240\u4EE5\u6CA1\u529E\u6CD5\u5B8C\u6210..\u5728\u52A0\u5F3A\u7ED3\u754C\u7684\u65F6\u5019\u4F60\u5E2E\u5FD9\u51FB\u9000\u98DE\u5934\u9B3C\u5427\u3002\u51FB\u900050\u4E2A\u5E94\u8BE5\u5C31\u591F\u4E86"
  },
  answer = {
