qt[2059] = {
  id = 2059,
  name = "[ \u519B\u58EB - \u97E9\u91CE\u57CE\u7684\u5371\u673A ]",
  contents = {
    "\u653B\u51FB\u97E9\u91CE\u57CE\u7684\u5170\u9709\u5320\u519B\u961F\u7684\u76EE\u7684\u4E0D\u4E00\u5B9A\u662F\u7834\u574F\u97E9\u91CE\u57CE\u3002\u6709\u60C5\u62A5\u8BF4\u662F\u4E3A\u4E86\u8BF1\u5BFC12\u4F4D\u5F1F\u5B50\u7684\u51FA\u73B0",
    "ANSWER_YES:\u4EC0\u4E48\uFF1F\u90A3\u5C82\u4E0D\u662F\u5BF9\u5170\u9709\u5320\u7684\u519B\u961F\u4E0D\u5229\u554A\uFF1F",
    "\u542C\u8BF4\u5F88\u4E45\u4EE5\u524D12\u5F1F\u5B50\u4ECE\u592A\u548C\u8001\u541B\u90A3\u513F\u4F20\u6388\u5230\u4E86\u5F88\u591A\u6B66\u529F\u3002\u636E\u63A8\u6D4B\uFF0C\u592A\u548C\u8001\u541B\u7684\u5F88\u5389\u5BB3\u7684\u6B66\u529F[\u960E\u7F57\u9B3C\u9B42\u5927\u6CD5]\u5E94\u8BE5\u4E5F\u4F20\u6388\u7ED9\u4E86\u5F1F\u5B50\u4EEC",
    "ANSWER_YES:\u65E2\u7136\u662F\u5F1F\u5B50\uFF0C\u5E94\u8BE5\u4F20\u6388\u4E86\u5427",
    "\u95EE\u9898\u662F\u5F1F\u5B50\u4E2D\u7684\u4E00\u4EBA\u5170\u9709\u5320\u6210\u4E3A\u4E86\u6076\u7684\u5143\u51F6\u3002\u592A\u548C\u8001\u541B\u4E0D\u53EF\u80FD\u4E0D\u77E5\u9053\u5170\u9709\u5320\u6709\u505A\u6076\u4E4B\u5FC3\uFF0C\u4E3A\u4E86\u4EE5\u9632\u4E07\u4E00\u5E94\u8BE5\u4F1A\u63D0\u524D\u51C6\u5907\u4E86\u5BF9\u7B56",
    "ANSWER_YES:\u90A3\u73B0\u5728\u903C\u774012\u5F1F\u5B50\u73B0\u8EAB\u662F..",
    "\u5BF9\u7684\uFF0C\u80AF\u5B9A\u662F\u60F3\u4E86\u89E3\u90A3\u4E2A\u5BF9\u7B56\u624D\u627E12\u5F1F\u5B50\u7684~\u4E0D\u8FC7\u4E3A\u4EC0\u4E48\u4E0D\u81EA\u5DF1\u627E\u800C\u662F\u6D3E\u51FA\u4E86\u624B\u4E0B\uFF0C\u73B0\u5728\u8FD8\u4E0D\u77E5\u9053",
    "ANSWER_YES:\u4E0D\u4F1A\u51FA\u4E86\u4EC0\u4E48\u95EE\u9898\u5427\uFF1F\u6BD4\u5982\u8BF4\u53D7\u4E86\u91CD\u4F24..",
    "\u90A3\u4E2A\u5929\u4E0B\u65E0\u654C\u5170\u9709\u5320\uFF1F\u5982\u679C\u771F\u6709\u8FD9\u79CD\u4E8B\u6211\u4EEC\u4E0D\u53EF\u80FD\u8FD9\u4E48\u9759\u5750\u7740~\u6B63\u90AA\u6D3E\u7684\u5E74\u8F7B\u8840\u6DB2\u4E5F\u6B63\u5728\u5BFB\u627E\u673A\u4F1A\u5462..\u7B49\u7B49\u3002\u4E5F\u6709\u53EF\u80FD\u771F\u6709\u8FD9\u79CD\u4E8B\uFF0C\u4F46\u56E0\u4E3A\u662F\u7687\u5BAB\u6240\u4EE5\u5C01\u9501\u4E86\u6D88\u606F\u4E5F\u8BF4\u4E0D\u5B9A~",
    "ANSWER_YES:\u7687\u5BAB\u91CC\u8FD8\u6709\u4EC0\u4E48\u5417\uFF1F",
    "\u7B49\u4F60\u54EA\u5929\u89C1\u5230\u4E86\u4F1A\u5403\u60CA\u7684\uFF0C\u7687\u5BAB\u91CC\u4F4F\u7740\u7687\u5E1D\uFF0C\u4E3A\u4E86\u4FDD\u969C\u5B89\u5168\u6240\u4EE5\u9009\u7684\u5730\u7406\u4F4D\u7F6E\u6613\u5B88\u96BE\u653B\uFF0C\u4EBA\u5F88\u96BE\u6DF7\u8FDB\u53BB\u7684\uFF01\u73B0\u5728\u5F53\u52A1\u4E4B\u6025\u662F\u8981\u5148\u901A\u77E5\u97E9\u91CE\u57CE\u624D\u884C",
    "ANSWER_YES:\u662F\u7684..\u4EC0\u4E48\uFF1F",
    "\u4F60\u662F\u518D\u597D\u4E0D\u8FC7\u7684\u4EBA\u9009\u4E86\uFF0C\u5FEB\u53BB[\u97E9\u91CE\u90FD\u57CE]\u5427\u3002\u90A3\u91CC\u6709\u7B2C9\u5F1F\u5B50\u51AC\u6DF7\u6C64\u7684\u5B59\u5B50[\u9AD8\u4E00\u71D5]\uFF0C\u4F60\u53BB\u544A\u8BC9\u4ED6\u8FDB\u653B\u7684\u9634\u8C0B\u5427~"
  },
  answer = {
    "\u597D\u7684\uFF0C\u6211\u8FD9\u5C31\u53BB",
    "\u4E3A\u4EC0\u4E48\u53C8\u662F\u6211\uFF1F\u4F60\u627E\u522B\u4EBA\u5427\uFF01"
  },
  info = {
