    "\u5DF2\u7ECF\u901A\u77E5\u4E86\u6B63\u90AA\u6D3E\u7684\u4EBA\uFF0C\u8BA9\u4ED6\u4EEC\u63D0\u9192\u4E00\u4E0B\u80FD\u8054\u7CFB\u768412\u5F1F\u5B50\u3002\u4E0D\u8FC7\u8C22\u8C22\u4F60\u7279\u610F\u8FC7\u6765\u5173\u5FC3~",
    "ANSWER_YES:\u6211\u662F\u4F20\u8FBE\u4F63\u5175\u9886\u8896\u7684\u8BDD\u800C\u5DF2",
    "\u6211\u4EEC\u73B0\u5728\u6709\u8981\u5B88\u62A4\u7684\u6751\u5B50\u548C\u4EBA\u4EEC\uFF0C\u6240\u4EE5\u4E0D\u80FD\u968F\u610F\u884C\u52A8\u3002\u4F46\u662F\u7B49\u5F7B\u5E95\u51FB\u9000\u4E86\u5170\u9709\u5320\u7684\u519B\u961F\u540E\uFF0C\u4F1A\u5168\u529B\u652F\u6301\u519B\u58EB\u7684\u3002\u6211\u4EEC\u6709\u5171\u540C\u7684\u654C\u4EBA\uFF01"
