  contents = {
    "\u5317\u74F6\u62BC\u4E0D\u77E5\u9053\uFF0C\u5176\u5B9E\u6211\u56E0\u4E3A\u4E4B\u524D\u7684\u4E8B\u60C5\u5931\u53BB\u4E86\u5343\u91CC\u773C\u7684\u80FD\u529B\u3002\u51C6\u786E\u7684\u8BF4\u662F\u5F31\u7684\u6CA1\u6709\u591A\u5927\u7528\u5904\u4E86",
    "ANSWER_YES:\u90A3\u4E5F\u5C31\u662F\u8BF4\u867D\u7136\u5F31\uFF0C\u4F46\u8FD8\u662F\u53EF\u4EE5\uFF1F",
    "\u5C31\u7B97\u53EF\u4EE5\u4E5F\u5C31\u662F\u53EA\u80FD\u77E5\u9053\u51A5\u73E0\u57CE\u5185\u90FD\u6709\u8C01\u7684\u7A0B\u5EA6\u3002\u4E0D\u8FC7\u5E78\u597D\u8FD8\u6709\u8FD9\u70B9\u80FD\u529B\uFF0C\u80FD\u907F\u5F00\u5170\u9709\u5320\u7684\u624B\u4E0B..",
