    "\u8981\u5C3D\u5FEB\u627E\u5230\u592A\u548C\u8001\u541B\u5E73\u606F\u8FD9\u4E2A\u5FE7\u60A3\u624D\u884C..\u4F46\u662F\u6211\u8DDF\u5317\u74F6\u62BC\u90FD\u56E0\u4E3A\u5170\u9709\u5320\u4E0D\u80FD\u968F\u610F\u8D70\u52A8\uFF0C\u6700\u8FD1\u4ED6\u7684\u624B\u4E0B\u53C8\u5F00\u59CB\u884C\u52A8\u8D77\u6765\u4E86~",
    "ANSWER_YES:\u60A8\u8BF4\u7684\u662F\u97E9\u91CE\u57CE\u7684\u4E8B\u60C5\uFF1F",
    "\u90A3\u4E9B\u53EA\u4E0D\u8FC7\u662F\u4E3A\u4E86\u8F6C\u79FB\u4EBA\u4EEC\u89C6\u7EBF\u7684\u7B56\u7565\u800C\u5DF2\u3002\u60F3\u7528\u90A3\u79CD\u5F88\u53D7\u4EBA\u77A9\u76EE\u7684\u884C\u52A8\u5438\u5F15\u5927\u591A\u6570\u4FA0\u5BA2\u4EEC\u7684\u6CE8\u610F\u540E\u60F3\u8FBE\u5230\u771F\u6B63\u7684\u76EE\u7684\uFF01",
    "ANSWER_YES:\u771F\u6B63\u7684\u76EE\u7684\uFF1F",
    "\u60F3\u628A\u5176\u4ED6\u5F1F\u5B50\u4EEC\u7684\u529F\u529B\u548C\u592A\u548C\u8001\u541B\u7559\u4E0B\u6765\u7684\u960E\u7F57\u9B3C\u9B42\u5927\u6CD5\u7684\u62DB\u5F0F\u5168\u90E8\u62FF\u8D70\u3002\u8FD9\u53EA\u662F\u6211\u7684\u63A8\u6D4B\uFF0C\u4F46\u5982\u679C\u771F\u7684\u8FBE\u5230\u90A3\u4E2A\u76EE\u7684\u7684\u8BDD\uFF0C\u5C31\u7B97\u662F\u592A\u548C\u8001\u541B\u4E5F\u514D\u4E0D\u4E86\u4E00\u573A\u82E6\u6218",
    "ANSWER_YES:\u6240\u4EE5\u5176\u4ED6\u5F1F\u5B50\u4EEC\u90FD\u8EB2\u8D77\u6765\u4E86\u662F\u5417\uFF1F",
    "\u518D\u8BF4\u6211\u5DF2\u7ECF\u5931\u53BB\u4E86\u5927\u90E8\u5206\u7684\u529F\u529B\uFF0C\u73B0\u5728\u8FDE\u5170\u9709\u5320\u7684\u624B\u4E0B\u90FD\u5BF9\u4ED8\u4E0D\u4E86~\u6240\u4EE5\u4F60\u80FD\u5E2E\u6211\u5417\uFF1F",
    "ANSWER_YES:\u8981\u4E0D\u6211\u53BB\u51FB\u9000\u5170\u9709\u5320\u7684\u90A3\u4E9B\u624B\u4E0B\uFF1F",
    "\u4E0D\u7528\u3002\u90A3\u6837\u5F88\u5BB9\u6613\u66B4\u9732\u6211\u4EEC\u7684\u4F4D\u7F6E\u3002\u6211\u7684\u4F2A\u88C5\u5C31\u7B97\u5170\u9709\u5320\u81EA\u5DF1\u627E\u6765\u4E5F\u4E0D\u4F1A\u8F7B\u6613\u770B\u7834\u7684\u3002\u4F60\u5E2E\u6211\u6536\u96C6\u4E00\u4E9B\u7EF4\u6301\u53D8\u88C5\u7684\u6750\u6599\u5427",
    "ANSWER_YES:\u54E6..\u4E0D\u80FD\u8349\u7387\u884C\u52A8\u554A~",
    "\u8C22\u8C22\u4F60\u7684\u7406\u89E3\uFF01\u6211\u9700\u8981\u7684\u662F[\u5927\u76EE\u738B]\u7684[\u5927\u76EE\u738B\u7684\u5934\u53D1]\u3002\u53EA\u898110\u4E2A\u5C31\u80FD\u7EF4\u6301\u4E00\u6BB5\u65F6\u95F4\u4E86\u3002\u5927\u76EE\u738B\u5728\u9752\u5CB3\u79C0\u6D1E\u7684\u6DF1\u5904\uFF0C\u62DC\u6258\u4E86\uFF01"
  },
