    "\u5F0A\u8D30\u6863 \u8001\u635E \u82AD\u72FC \u4ED8\u516C\u5E9C\u7B49 \u77EB\u75E2\u635E\u627C \u5956\u9738 \u635E\u5177\u6241 \u79E6\u4E34 \u5DF4\u635E\u627C \u79EF\u963F\u6C81\u7EF0\u5355, \u9152\u806A\u83CC\u7119\u5938.",
    "ANSWER_YES:\u8D2D\u554A \u8350\u752B \u90F4\u5177\u6446\u56BC\u806A\u4FC3.",
