    "ANSWER_YES:\u4F43\u7ECA\u710A\u806A \u560E\u7EF0 \u5BCC\u9756\u635E\u7EDE\u806A\u4FC3.",
    "{0xFFFFFF00}\u9976\u6551\u84D6\u90E8\u5E9C\u7EF0 \u9976\u6551\u84D6\u752B \u787C\u6479{END}\u7A8D\u6401 \u6398\u9611 \u8350 \u4E50\u56BC\u806A\u4FC3. {0xFFFFFF00}\u63AA\u5531\u516C\u7792\u7EF0 \u710A\u70F9 \u72FC\u76D4\u4E1B\u7538\u635E \u79D2\u97AD{END}\u94A6\u806A\u4FC3. \u6863\u6846\u635E \u767B\u7EF0 \u6CA5\u710A\u806A\u9CD6 \u66FC\u7ECA\u7A8D\u77EB\u6401 \u6863\u6846\u635E \u77AA\u75A4\u806A\u4FC3."
