    "ANSWER_YES:\u529B \u5BCC \u7CB1 \u7538\u7EE2\u710A\u77EB\u70C8. \u7624\u965B \u978D\u7BEE \u62F1\u6252\u9611 \u7BAD\u78CA\u7236 \u5B98\u5C42\u554A\u6401\u8F91 \u5938\u5907\u7A8D\u811A\u82AD \u9152\u6280\u5938?",
