    "ANSWER_YES:\u529B \u5BCC\u6863 \u7CB1 \u7538\u7EE2\u710A\u627C\u7ECA\u5938. \u5F0A\u6210 \u8D38\u6F9C\u4F55\u78D0 \u8179\u635E \u5907\u79E6\u5D14\u627C\u7ECA \u7A8D\u77EB\u6401 \u767B\u5792\u9152\u5938. \u5777\u8D30\u7B49\u5531\u98CE\u78D0\u9CD6\u7624\u554A \u5014\u4ED8\u5531 \u94A2\u5E9C \u4E50\u7EF0\u7624 \u9152\u6280\u5938?",
    "\u6784, \u83C7\u635E! \u635E \u4EC7\u635E \u7EE2\u8776\u63AA\u7ECA \u8776\u51A0\u8776\u51A0 \u5BCC\u63AA\u64CD\u5177! \u635E \u4EC7\u9152, \u62F3\u8DDD\u635E\u9102 \u62F1\u6252\u635E \u56BC\u6241\u4FCA \u5014\u4ED8\u5531 \u8DDD\u8304 \u4E34\u7BEE \u8205\u7ECA \u5F0A\u7E41 \u5BB6\u526F \u7A8D\u7EF0 \u9738\u886C? \u5531\u5177\u5BCC\u80BA \u5386\u6241 \u8304\u554A\u57AB \u6EF4\u7ECA \u76D4\u7EDD\u635E \u89D2\u6C30\u7A8D\u6401 \u4EAE\u6446\u4FC3. \u56BC\u6241\u5188\u7ECA \u82DF\u5A9A\u67F3 \u62F3\u8DDD\u4FCA \u5676\u6479\u9F99\u7A8D\u4FC3 \u78D0\u5EC9\u78F7\u9611 \u8D64\u7C4D! \u5386\u5E9C\u554A! \u6B79 \u635E\u60D1 \u88C1\u6863 \u710A\u6241 \u997A\u4FC3!"
  },
  answer = {
