  name = "[ \u8721\u7262 \u7D2F\u50881 ]",
  contents = {
    "\u72FC\u86C6\u4E1B \u808B \u5777\u7EE7\u56BC\u806A\u4FC3.",
    "ANSWER_YES:\u5FEB\u8001\u9F8B\u4E1B\u9611 \u70F9\u79E6\u8F91 \u7538\u83CC\u56BC\u806A\u4FC3. \u5386\u752B \u832B\u680F\u7EE7\u4FC3\u7ECA\u5938?",
    "\u6297. \u7624\u6C7E\u6982\u6C72\u7BEE \u635E\u529B \u82AD\u72FC \u4FC3 \u573A\u8F66\u56BC\u806A\u4FC3. \u5F0A\u7E41\u5355 \u5DE9\u529B\u554A \u4E50\u56BC\u806A\u4FC3.",
    "ANSWER_YES:\u5DE9\u529B\u627C\u50A8? \u7EE2\u606B \u5DE9\u529B\u554A \u4E50\u4FC3\u7EF0 \u5BCC\u7262\u554A\u5938?",
    "\u7624\u6C7E\u72FC \u56BC\u6241 \u5DE9\u529B\u6D9D\u806A\u4FC3. \u62F3\u8DDD\u516C\u6241\u9102 \u5DF4\u635E \u76D4\u8D30 \u56BC\u6241\u5531 \u62F1\u4FCA \u8DDD\u7A8D\u5792\u56BC\u806A\u9CD6?",
    "ANSWER_YES:\u5F0A \u5DE9\u529B\u627C\u6401 \u79E6\u642C?\u7538\u83CC\u56BC\u806A\u4FC3\u7236?",
    "\u6297. \u7A8D\u7624\u7236 \u5448\u516C \u5777\u6CD5\u60BC\u6551 \u6EF4\u6401 \u5F00\u77EB \u56F0\u4EFF\u635E \u8DDD\u79E6\u7B3C\u806A\u4FC3. \u5F0A\u8D30\u8F91 \u5386\u7EF0 \u5E45\u788D\u9611 \u6863\u60EF\u7A8D\u7EF0 \u5088\u7A9C\u7624\u752B \u8179\u635E \u7236\u7538\u7EE2\u8F91 \u7845\u5668\u4E14 \u79EF\u963F\u6D9D\u806A\u4FC3.",
    "ANSWER_YES:\u5088\u7A9C\u7624\u752B\u5938?",
    "\u6297, \u5E45\u788D\u635E \u80F6\u80F6\u80BA \u62F3\u554A\u5531\u8F91 \u8D38\u7538\u7EE2 \u5777\u6863\u5E9F \u8721\u6863\u4E14 \u79EF\u963F\u6D9D\u806A\u4FC3. \u635E \u8001\u9611 \u67F3\u9752\u7A8D\u59A8\u6401 {0xFFFFFF00}\u8D8B\u788D\u77EB\u72FC \u8350\u72FC 100\u4FFA\u5BA2 \u5188\u5FEB\u84D6\u72FC \u84D6\u811A\u7538\u8D74\u9E64 30\u4FFA{END}\u635E \u9798\u5938\u94A6\u806A\u4FC3. \u6863\u5BA2\u6797\u89D2\u8350 \u4E50\u680F\u77EB\u70C8?"
  },
  answer = {
    "\u62F1\u6CB8\u6D9D\u806A\u4FC3. \u6863\u5BA2\u975B\u5E9C\u6446\u56BC\u806A\u4FC3.",
    "\u5E45\u788D\u635E \u5F0A\u7E41 \u6350\u7BEE \u8350\u4FCA \u52A0\u9611 \u9CD6\u5938?"
