qt[2376] = {
  id = 2376,
  name = "[ \u8721\u7262 \u7D2F\u50882 ]",
  contents = {
    "\u54AF\u77FE \u5398\u72FC \u5088\u7A9C\u7624\u554A \u529B\u7D2F\u767B\u7EE2 \u7845\u5668\u767B\u83CC\u56BC\u806A\u4FC3. \u72FC\u86C6\u4E1B\u818A \u7691\u8364\u975B\u8D4B\u806A\u4FC3.",
    "ANSWER_YES:\u5BF8\u6977\u6D12 \u79E6\u5177\u4E14 \u8001\u9611 \u6C81\u56BC\u806A\u4FC3.",
    "\u4ED8\u7624\u961C\u680F\u80BA \u4F55\u6BB4\u635E \u4E50\u56BC\u806A\u4FC3. \u635E \u5088\u7A9C\u7624\u752B \u5E45\u788D\u4FCA\u9738 \u6D41\u7ACB \u5088\u5D14\u79E6\u6797\u6280\u5938.",
    "ANSWER_YES:\u6D41\u7ACB \u5BCC\u6D9D\u806A\u9CD6?",
    "\u6297. \u72FC\u86C6\u4E1B\u4FCA \u63AA\u8304 \u5E45\u788D\u72FC \u811A\u6C7E\u6863 \u4FC3\u9F99 \u8350 \u4E50\u7ECA, \u642C\u6CA5\u5229\u680F\u80BA \u5E45\u788D\u635E \u652B\u529B \u635E \u5088\u7A9C\u7624\u752B \u676D \u8350 \u4E50\u9611\u7624 \u5398\u6DEC\u9611 \u7ED9\u94A6\u806A\u4FC3."
  },
  answer = {
    "\u529B\u554A \u6D41\u7ACB \u5E45\u788D\u4FCA\u9738 \u5088\u5D14\u7624\u752B \u5088\u5D14\u7A8D\u6446\u56BC\u806A\u4FC3.",
    "\u808B\u7ED9\u79E6\u8F91 \u5386\u7236 \u56FD\u7F50\u680F\u6401 \u7EE2\u94DD\u806A\u9CD6? \u5088 \u7ED9\u94A6\u806A\u4FC3."
