  name = "[ \u7D2F\u5088 \u5DF1\u508D! ]",
  contents = {
    "\u5F0A \u60BC\u6551 \u7EE2\u53FC\u62CC\u7EE7\u56BC\u806A\u9CD6?",
    "ANSWER_YES:\u516C\u90CA \u97AD\u8304\u8001\u635E \u4E50\u5531\u5938? \u8DA3\u77EB \u5E45\u788D\u7BEE \u7EE2\u9A82 \u767B\u83CC\u5531\u5938?",
    "\u72FC\u86C6\u4E1B\u72FC \u63AA\u529D\u8DDD\u680F\u80BA \u5E45\u788D\u72FC \u7A83\u63AA\u7EF0 \u60D1\u6C1F\u82DE \u60BC\u77EB\u4FCA \u5974 \u4E54\u79E6\u752B \u6D9D\u7ECA \u6863\u6797\u6C81\u56BC\u806A\u4FC3.",
    "ANSWER_YES:\u9152, \u5F0A\u72AF\u56BC\u806A\u9CD6? \u6CA5\u5BCC \u4FC3\u9752\u6D9D\u806A\u4FC3.",
    "\u845B\u6EF4 \u72FC\u86C6\u4E1B\u72FC \u7574\u4EFF\u82DE \u7624\u9A71 \u50A3\u76D2\u6D9D\u806A\u4FC3. \u72FC\u86C6\u4E1B\u818A\u8F91 \u5267\u53A9\u4E5E \u7119\u63AA\u752B \u52A0\u7262 \u50A3\u76D2\u4FCA \u6CA5\u5BCC \u5974 \u56F0\u6241\u752B \u54C8\u7EE2\u8F66\u56BC\u806A\u4FC3."
  },
  answer = {
    "\u6CA5\u72FC\u752B \u89D2\u73AB\u6C81\u9611 \u6325\u6D9D\u806A\u4FC3. \u83AB\u86EE\u7F50\u9611 \u8001\u7BEE \u9152\u51D1\u806A\u4FC3.",
    "\u5F0A\u70E6 \u6363\u680F\u80BA \u6797\u6280\u5938. \u5F0A\u72AF\u9738 \u8364\u6069\u9611 \u4F55\u59A8\u5188\u7ECA \u6363 \u8304\u4E7E\u6863 \u6551\u51DB\u806A\u9CD6?"
