    "\u7EE2\u503E \u5F0A \u8364\u6069\u6863 \u66FC... \u54AF\u6241\u8F91 \u7845\u752B \u9E25\u6401 \u54CE\u9551\u7BEE \u84D6\u6797\u6863 \u6325\u635E\u627C\u5777. \u5F0A\u7E41\u5355 \u90F4\u554A \u5777\u9600\u60BC\u6551 \u5F0A\u9551\u680F\u80BA \u7845\u752B \u5241\u6B3E \u8001\u635E \u7EDD\u7EE2\u5938. \u516C\u90CA \u72FC\u56FA\u7262\u7624 \u9152\u77EB\u6446\u5BB6?",
    "ANSWER_YES:\u5F0A\u70E6 \u56F0\u7624\u8350\u4E1B\u635E \u9152\u806A\u627C \u9152\u6297 \u8364\u6069\u9611 \u7ED9 \u7236\u8F66\u7A9C \u5BCC\u6D9D\u806A\u9CD6?",
