    "ANSWER_YES:\u5F0A\u72AF\u56BC\u806A\u4FC3.",
    "\u7A9C\u9274\u8304 \u6241\u6485\u60D1\u89D2\u978D\u9152 \u710A\u635E\u67F3 \u81FC\u7EF0\u5355, \u710A\u70F9 \u5F0A\u7E41 \u8364\u6069\u7538\u7BEE \u4FC3\u5F17 \u710A\u9F8B\u78CA\u554A \u5355\u5E9C\u7ECA \u5777\u9738 \u4ED8\u8BBF\u635E\u82AD\u7535. \u78CA\u6241 \u60EF\u80BA \u832B\u9152\u542D\u4FC3\u6401, \u4F55\u76D2 \u6241\u6485\u60D1\u89D2\u7262\u554A?",
    "ANSWER_YES:\u9152\u51D1\u806A\u4FC3. \u6784\u627C\u7ECA \u79E6\u5177\u7A8D\u5531...",
    "\u89C8?",
    "ANSWER_YES:\u5F0A\u77FE\u806A\u9CD6... \u6241\u6485\u635E \u70BC\u963F \u8F66\u4FC3\u7ECA... \u9152\u806A \u5F0A\u7E41\u9738 \u9152\u806A\u7ECA",
