    "\u5D14\u7ECA \u6241\u629A\u7624\u7ECA \u77EB\u76D4\u8304 \u5DF4\u9611 \u5188\u680F\u806A \u635E\u529B \u7CB1 \u6DF7\u5DF4 \u978D\u7119.",
    "ANSWER_YES:\u6297. \u5F0A\u77FE\u5BC2\u5177\u70C8.",
    "\u9152 \u5F0A\u5E9C\u7ECA \u5BCC\u7262\u5355. \u9B54\u9611 \u560E\u82AD\u5531 \u78CA\u811A\u635E \u52B3\u69DB\u6C81\u5E26 \u5DF4\u680F\u80BA \u710A\u635E\u7EF0 \u8001\u7538. \u5F0A\u7E41\u5DF4\u9611 \u6C81\u83CC\u5E26 \u5DF4\u7538\u635E \u5088\u56DA \u74E4\u82DE\u554A \u7EDD\u83CC\u7624?",
    "ANSWER_YES:\u5F0A\u72AF\u56BC\u806A\u4FC3.",
    "\u5F0A\u70E6 \u78CA\u5319, \u82DE\u82AD \u78CA\u811A\u635E \u7A7F\u7119\u7624\u7EF0 \u8205\u7ECA \u4E50\u53D8 \u7A8D\u7119.",
    "ANSWER_YES:\u6297?",
    "\u9152\u4ED8 \u7EE2\u606B \u8001\u9611 \u7A17\u680F\u6401\u8F91 \u67EF\u5088\u6D12 \u78CA\u811A\u72FC \u5DF4\u635E \u9152\u806A\u7624\u7236, \u78CA\u811A\u635E \u7EE2\u606B \u8364\u6069\u635E\u83CC\u4FC3! \u635E\u7E41 \u5DF4\u9611 \u5F25\u8F9F\u4FCA \u8205\u9738\u7B49 \u5DF4 \u978D\u7119.",
    "ANSWER_YES:\u7EE2\u75D8\u9738 \u9152\u7EE7\u56BC\u806A\u9CD6?",
    "\u78CA\u811A\u635E \u7A7F\u7119\u7624\u6863 \u845B\u798F\u7EF0 \u60D1\u6015\u4FCA\u8F91 \u542D\u680F\u6401 {0xFFFFFF00}'\u6241\u6485\u9611 \u916A\u83CC\u4FC3. \u832B\u9152\u5D14\u627C.'{END} \u627C\u7ECA \u5BCC\u6C81\u6446\u7624. \u7A8D\u7624\u7236 \u78CA\u5319\u7EF0 \u6241\u6485\u9611 \u916A\u7BEE \u5DF4\u9611 \u7262\u7624\u7A8D\u7ECA \u5F0A\u5DF4\u9611 \u832B\u680F\u59A8\u7ECA \u7574\u4EFF\u541D\u635E\u627C\u7ECA \u6C81\u5792\u7BEE\u554A. \u6CA1\u6F9C\u5305\u72FC\u76D4\u72FC \u9B54\u8D31\u7BEE \u6982\u5FEB \u8721\u7599\u8304 \u6479\u4E30\u8FC7\u635E\u5177. \u5F0A\u7E41\u5355 \u5F0A\u9738 \u74E4\u82DE\u554A \u7EDD\u83CC\u5E26 \u845B\u5267\u635E\u5177.",
    "ANSWER_YES:!!!",
    "\u8001\u7A9C \u7624\u965B\u9CD6\u7624 \u6BEB\u67EF \u6241\u6485\u60D1\u89D2\u60D1\u6015\u72FC \u4FC3\u5F17 \u5238\u78CA\u7538\u82DE \u78CA\u5319\u7EF0 \u5448\u516C \u5D14\u627C. \u516C\u508D\u9611 \u6241\u6485\u7A8D\u7EF0 \u6241\u6485\u60D1\u89D2\u5218\u635E\u627C\u806A, \u63AA\u5398\u5398\u635E\u7EF0 \u6241\u6485\u60D1\u89D2\u5218\u4FCA \u5427\u59A8\u6863 \u5676\u6479\u9F99\u9611 \u7A8D\u7EF0 \u8FC7\u7BEE \u6241\u6485\u7A8D\u7624. \u5F0A\u6252 \u4E2A\u635E\u82AD\u7535. \u7A8D\u7624\u7236 \u6863\u5907\u7EF0 \u7ED9\u7236\u7538\u7EE2. \u5F0A\u6252 \u8D63\u5E9C\u82AD\u7535.",
    "ANSWER_YES:...",
    "\u516C\u508D\u6863 \u4ED8\u86EE\u554A\u7624\u5177. \u503E\u508D\u4FCA \u6F20\u9F99\u7BEE \u4E14\u8350 \u4E50\u6446\u7624\u7236, \u5938\u786B\u978D\u7BEE \u4ED8\u62F1\u7538\u635E \u57AB\u89D2\u82AD\u5E9C\u7EF0 \u6280\u60D1\u4FCA \u516C\u508D\u680F\u80BA \u5DE2\u7538 \u6863\u542D\u4FC3? \u78CA\u5319\u7EF0 \u8001\u9986\u5229\u7262 \u6241\u6485\u60D1\u89D2\u5218\u60D1\u635E \u9152\u806A\u5177. \u710A\u70F9 \u710A\u9F8B\u78CA \u988A\u4FCA \u7F20\u59A8\u5777\u9738 \u4ED8\u8BBF\u7262 \u5238\u78CA\u7538\u82DE \u78CA\u5319\u7EF0 \u5448\u516C \u5D14\u627C."
  },
  answer = {
    "\u7EE2... \u6F9C... \u9152\u806A \u8FED\u6D12 \u7EE2\u798F\u811A\u9611 \u52A0\u635E\u82AD\u5531 \u5F0A\u77FE\u59A8\u5E26 \u5DF4\u635E..."
