  name = "[ \u6241\u6485\u9887\u7948\u70BC\u963F5 ]",
  contents = {
    "\u7CB1 \u854A\u76D2\u7BEE \u554A\u627C\u65E7\u75BD\u5531?",
    "ANSWER_YES:\u6297.",
    "\u5531\u6863 \u8001\u7A9C \u8364\u82DE\u7A8D\u7624. \u5448\u516C \u78CA\u5319\u752B \u9694\u9152\u563F\u7262\u5DF4 \u978D\u75BD\u7624? \u5531\u6863 \u78CA\u5319\u978D\u7BEE \u7248\u5FEB\u7EF0 \u8D38\u6F9C\u6BEB\u8F91 \u8179\u635E \u6101\u8033\u83CC\u7624.",
    "ANSWER_YES:\u5F0A\u72AF\u7119\u5938.",
    "\u5531\u6863 \u5F0A\u60BC\u6551 \u54AF\u77FE\u554A\u7624 \u89C4\u8FC7\u9611 \u79EF\u963F\u79E6\u710A\u75BD\u7624. \u8DA3\u77EB {0xFFFFFF00}\u6241\u6485\u9887\u7948\u70BC\u963F{END}\u635E\u627C\u7ECA \u7538\u7EE2\u592F \u5229 \u4E50\u7EF0\u554A?",
    "ANSWER_YES:\u8D38\u6F9C \u7538\u7EE2\u58D5\u806A\u4FC3.",
    "\u70E4\u671D \u5DE9\u6E05\u4FCA \u5DE2\u9152\u4E50\u5E26 \u90F4\u4FA9\u635E\u7624. \u710A\u70F9 \u6241\u6485\u635E\u9102 \u5DF4\u7BEE \u8D63\u5E9C\u4FCA \u5EB7\u76D4\u6D12 \u5DE2\u9152\u4E50\u7624. \u5F0A\u5DF4\u9611 \u5C48\u60D1\u62F3\u77EB\u96BE\u8F91 \u70BC\u963F\u680F\u80BA \u7236\u7538\u7EE2\u90F4\u7EF0 \u5DF4\u635E\u7624. \u4ED8\u62F1\u7538\u9611 \u787C\u6479\u7A8D\u6401 \u5531\u5777\u7EF0 \u70BC\u963F\u82DE \u539A\u6405\u8304 \u5DF4\u635E\u627C\u5319. \u5C48\u60D1\u62F3\u7B49 \u6241\u6485\u9611 \u4FC3\u77EB \u8F6F\u8350\u7A8D\u7EF0 \u5DF4\u635E\u7624."
  },
  answer = {
    "\u4ED8\u62F1\u70BC\u963F\u635E\u627C... \u7CB1 \u635E\u79E6\u554A \u9093\u806A\u4FC3.",
