    "\u5DE9\u529B\u75E2? \u7A9C\u75E2? \u5F0A\u72AF\u7624. \u635E\u6252 \u5676\u963F\u9611 \u5C48\u60D1\u62F3\u77EB\u632A\u4FC3\u7ECA \u676D\u8350\u6863 \u4E50\u7EE2. \u8364\u6069\u72FC \u6241\u6485\u635E\u9102 \u5DF4\u7BEE \u66FC\u680F\u80BA \u7EA7\u6280\u7A8D\u6401\u8F91 \u635E\u6241\u5229\u635E\u5177. \u78CA\u811A\u72FC \u710A\u7ECA \u9175\u7624\u81FC\u5E26, \u956D\u7EE2\u6EDA\u5E9C\u7ECA \u9175\u83CC\u5E26 \u82DE\u82AD\u7EF0 \u956D\u7EE2\u6EDA\u5E9C\u9738 \u767B\u7624. \u5676\u963F\u72FC \u8304 \u8F86\u5E45\u7624.",
    "ANSWER_YES:(\u5BCC \u7EDD\u635E \u7ECA\u4FFA\u752B \u63BA\u50A3\u7262\u4FC3.)",
    "\u7236\u8DDD \u70BC\u963F\u680F\u80BA \u5531\u67EF \u6241\u6485\u635E \u956D\u7EE2\u6EDA\u5E9C\u7ECA \u9175\u5E26 \u82DE\u82AD\u554A \u5531\u9E25\u6284\u4FC3\u6401? \u5F0A \u9762\u62DC\u9611 \u7691\u5BF8\u4E14 \u78CA\u811A\u635E \u4E50\u5531?"
