    "\u4ED8\u62F1\u9611 \u7A7F\u554A \u521A\u5386 \u787C\u6479\u7A8D\u7EF0\u7624 \u7248\u91CC\u9611 \u94A6\u77EB\u4FC3. \u5FEB\u6025\u7BEE {0xFFFFFF00}\u5B7A\u84D6\u8D8B\u80BA{END}\u4FCA \u514D\u9694\u7A8D\u7EF0 {0xFFFFFF00}\u8350\u965B\u9152{END}\u627C\u7EF0 \u4ED8\u62F1\u80BA \u94A6\u77EB\u4FC3. 130\u4ED8\u5E9C\u752B \u7A7F\u554A \u521A\u5386 \u787C\u6479\u7A8D\u7EF0\u7624 \u7248\u91CC\u79E6\u58D5\u77EB\u4FC3."
