  name = "[ \u5B7A\u9F8B\u72FC\u7ECA\u5F52 ]",
  contents = {
    "\u5777\u5777, \u542D\u7EF0\u554A? \u5F0A\u8D30, \u516C\u90CA \u8001\u80BA \u542D\u7EF0\u554A?",
    "ANSWER_YES:\u4FC3\u629A\u635E \u9152\u806A\u627C \u8304\u5F52\u4E1B \u4E50\u5792\u56BC\u806A\u9CD6?",
    "\u5F0A\u4EC7 \u635E\u5177\u6241\u627C\u6401 \u7A8D\u7624\u5BCC\u9738. \u4EAE\u5E26 \u6241\u76D2\u635E \u5531\u72D0\u7624\u59A8 \u7A8D\u7624\u81FC\u7EF0\u554A! \u7EE2\u8D74\u4EC7\u635E \u6252\u89C4\u7624\u7ECA \u78CA\u6241 \u541D\u7F34\u5229\u635E\u7ECA \u5BCC\u635E\u5177.",
    "ANSWER_YES:\u9152.. \u5F0A\u7E41 \u8364\u6069\u7262\u554A\u5938?",
