qt[2550] = {
  id = 2550,
  name = "[ \u6CA1\u59A8\u508D\u6797\u72FC \u7ECA\u522E\u79E6\u642C ]",
  contents = {
    "\u4FC3\u8D64 \u5777\u7EE7\u56BC\u806A\u9CD6? \u541D\u57C3\u4FCA \u4ED8\u62F1\u7538\u72FC \u508D\u62DC\u6863 \u7A83\u818A \u961C\u680F\u7EE7\u4FC3\u7ECA \u7538\u83CC\u56BC\u806A\u4FC3. \u8E0C\u8986\u5DF1\u9611 \u63AA\u948E\u79E6\u8F91 \u7691\u8364\u975B\u8D4B\u806A\u4FC3.",
    "ANSWER_YES:\u5B9D\u6EE1\u56BC\u806A\u4FC3. \u635E\u56FA \u7538\u680F\u7EE7\u6446\u7624\u7236, \u4ED8\u62F1\u7538\u9611 \u961C\u9611\u952D \u6EF4 \u62DC\u6367\u554A\u4E1B\u7538\u82DE \u7A83\u818A \u8F7F\u594E\u56BC\u806A\u4FC3.",
    "\u6297. \u7538\u83CC\u56BC\u806A\u4FC3.",
    "ANSWER_YES:\u5F0A \u50A3\u76D2\u7262\u7624 \u6EF4 \u76D2\u72FC \u8D3E\u6D41\u8304 \u4ED8\u6F9C\u9611 \u8205\u8350 \u4E50\u83CC\u56BC\u806A\u4FC3.",
    "\u6CA5\u5BCC \u4FC3\u9752\u6D9D\u806A\u4FC3. \u5F0A \u76D2\u7538\u72FC \u79EF\u963F\u7BEE \u7EE2\u75D8\u5E26\u554A\u5938?",
    "ANSWER_YES:\u6EF4 \u76D2\u7BEE \u8F91\u80BA\u72FC \u89D2\u4EFF\u9611 \u7262\u6CA5\u7A8D\u7ECA \u4E50\u83CC\u56BC\u806A\u4FC3. \u8304\u5F52\u4E1B\u7BEE \u5BC7\u4F20\u70D9\u4FCA\u6863 \u78CA\u811A\u82DE \u89D2\u4EFF\u635E \u539A\u6405\u8304 \u5B7A\u9F8B\u4E1B\u9611 \u63AA\u7A9C\u7A8D\u4FC3\u7ECA \u6C81\u56BC\u806A\u4FC3.",
    "\u6CA5\u5BCC\u7262\u554A\u5938? \u5F0A\u70E6 \u5B7A\u9F8B\u4E1B\u72FC \u79EF\u963F\u7BEE \u7EE2\u680B\u6C81\u56BC\u806A\u9CD6?",
    "ANSWER_YES:\u5B7A\u9F8B\u4E1B\u6863 \u78CA\u811A\u710A\u4FC3 \u7EE2\u8D74 \u8304\u5F52\u4E1B\u9611 \u63AA\u7A9C\u7A8D\u4FC3\u7ECA \u6C81\u56BC\u806A\u4FC3. \u519C\u9738 \u634C\u6CA5\u7A8D\u89D2 \u8350 \u7EDD\u4FC3\u7ECA \u58D5\u806A\u4FC3.",
    "\u5F0A\u72AF\u7624\u7236 \u5F0A\u7E41 \u4ED8\u6F9C\u9611 \u67F3\u89D2\u767B\u9738 \u5BCC\u7A8D\u7624 \u81FC\u7ECA \u7F34\u7624\u7EE2 \u8F91\u80BA\u752B \u539A\u89C4\u7A8D\u7EF0 \u5DF4\u7BEE \u5DE9\u529B\u627C\u7ECA \u58D5\u806A\u4FC3."
  },
  answer = {
    "\u5F25\u7ECA\u554A \u767B\u7ECA \u9175\u7BEE\u5355 \u4FC3\u5F17 \u7A7F\u7119\u554A\u752B \u5F25\u7ECA\u627C\u7ECA \u5956\u9738 \u7262\u6CA5\u7A8D\u7ECA \u9175\u7624\u7EF0 \u81FC\u9611 \u75A4\u806A\u4FC3. \u62DC\u6367\u554A\u72FC \u78CA\u7CAE\u7F34 \u978D\u7BEE \u5DF4\u635E\u70C8.",
    "\u6CA5 \u5F0A\u77FE\u77EB\u6401 \u529B\u554A \u5386\u9505\u4FCA \u5BCC\u6C81\u5E26 \u8E0C\u8986\u529B\u8001 \u516C\u6367\u63AA\u96C0\u752B \u51EF\u7EE2\u8F91 \u7B1B\u541D \u7A7F\u554A \u788D\u8304\u7624 \u8F7F\u51B5\u710A\u9738 \u94A6\u77EB\u4FC3."
  },
  info = {
    "{0xFFFFFF00}[\u8E0C\u8986\u6863\u5DF1]{END}\u4FCA\u8F91 {0xFFFFFF00}[\u6CA1\u59A8\u508D\u6797]{END}\u5BA2 \u635E\u5177\u6241\u752B \u7A8D\u78CA."
