    "ANSWER_YES:\u6241\u4FC3\u5561\u4FC3\u50A8? \u516C\u90CA \u8001\u635E \u79EF\u677F\u5531\u5938?",
    "\u9F8B\u60EB\u710A\u7ED5\u72FC \u5D14\u9611 \u560E\u635E\u79E6\u8F91 \u56F0\u5DE9\u7948\u7624\u752B \u710A\u90F4\u59A8\u7EF0 \u76D2\u7538\u635E \u8179\u9152\u5938. \u51EF\u7F34\u6D12 \u7845\u5D14\u9611 \u6C81\u7624\u7236, \u9152\u6D41\u6863 \u5088\u5D14 \u7ED9\u8304 \u56F0\u5DE9\u7948\u7624\u554A \u8179\u635E \u4E50\u7FE0\u806A\u4FC3.",
    "ANSWER_YES:\u56F0\u5DE9\u7948\u7624\u627C, \u66FC\u680F\u80BA \u60F9\u6DAA\u8304 \u79EF\u963F\u6D9D\u806A\u4FC3. \u8001\u988A\u635E \u4F55\u7EC3\u7A8D\u4FC3\u6401, \u529B\u554A \u6863\u5BA2\u975B\u5E9C\u6446\u56BC\u806A\u4FC3.",
    "\u6CA5\u5BCC\u635E\u811A\u554A\u5938? \u845B\u7535 \u76D2\u7538\u9611 \u63AA\u948E\u79E6\u8F91 \u7691\u8364\u975B\u8D4B\u806A\u4FC3. \u5F0A\u70E6 \u529B\u554A \u5B98\u80BA {0xFFFFFF00}\u56F0\u5DE9\u7948\u7624{END}\u752B \u975B\u5E9C\u6446\u56BC\u806A\u4FC3.",
    "ANSWER_YES:\u5F27\u5E9C \u6797\u6280\u5938. \u965B\u89C4 \u4FC3\u8D64\u5777\u6446\u56BC\u806A\u4FC3.",
    "\u6CEA\u77EB\u7236\u5938, \u5088\u5D14\u7F50\u9611 \u76D2\u635E \u7A7F\u5907\u7262\u7624 \u9152\u5BC2\u5177\u70C8. \u5FEB\u6025 {0xFFFFFF00}\u56F0\u5DE9\u7948\u7624{END}\u752B \u7F50\u680F\u77EB\u6401 \u5FEB\u52AA\u8150\u680F\u80BA \u7948\u7624\u752B \u51EF\u7EE2\u8F91 \u7948\u7624\u752B \u7F50\u9611 \u76D2\u635E \u7A7F\u5907\u7262\u7624 \u521A\u5386 \u72AC\u7262\u79E6 \u6797\u6280\u5938."
