    "ANSWER_YES:\u6297, \u5F0A\u72AF\u56BC\u806A\u4FC3.",
    "\u635E \u7948\u7624\u7EF0 \u5DE2\u6D45\u5305\u4FC3\u5E9C\u4FCA \u4E50\u7EF0 \u5DE2\u6D45\u5305\u7248\u539A1\u4E1B\u818A \u5088\u5D14\u79E6\u975B\u5E9C\u6401 \u9093\u806A\u4FC3.",
    "ANSWER_YES:\u7EE2? \u7948\u7624\u8C6A\u6367\u554A \u51EF\u59A8\u4E50\u7119\u5938. \u635E\u77FE\u6401 \u7948\u7624\u752B \u916A\u7EE2\u6EDA\u526F \u8350\u6863 \u4E50\u7EF0\u5355... \u635E\u7E41, \u6551\u4FCA \u90F4\u4FA9\u635E \u4FC3 \u710A\u635E\u5319\u5938.",
    "\u5F0A\u70E6 \u6DF7\u5A04 \u4F6C\u7EE2\u710A\u7ECA \u8C6A\u6367\u752B \u6467\u9152\u6797\u70C8. {0xFFFFFF00}\u6551\u5D07\u7A8D\u6280\u5938. \u808B\u79EF\u53D8 \u5DE2\u6D45\u5305\u7248\u539A1\u4E1B\u818A \u635E \u7948\u7624\u752B \u710A\u5FF1\u806A\u4FC3. \u5386\u7EF0 \u9152\u5386\u63EA\u554A \u5448\u516C \u4EAE\u9152\u5938. \u6050\u886C\u6401 \u808B \u79EF\u677F\u680F\u806A\u9CD6\u5938. \u88AB\u9738 \u4FC3\u5DE9 \u6D9D\u82DE \u6CE5\u8350\u582A\u635E \u6F02\u6D12 \u6982\u4EFF\u5229\u6D9D\u806A\u4FC3. -\u5DE2\u6D45\u5305\u7248\u539A1 \u57D4\u52AA\u53CD \u96C0\u5398-{END}",
    "ANSWER_YES:\u57D4\u52AA\u53CD\u635E\u627C\u7ECA\u5938? \u5F0A\u76D2\u635E \u5F0A\u72AF\u9738 \u808B\u79EF\u677F\u5531\u5938?",
    "\u5F0A... \u81C2\u75A5\u5938, \u5386\u7EF0 \u5F0A\u76D2\u9611 \u8304\u9505\u6863 \u6838\u7624 \u7ED9\u79E6\u8F91 \u8205\u8350\u554A \u7EDD\u7119\u5938. \u7948\u7624\u8C6A\u6367\u7EF0 \u808B \u6467\u75BD\u680F\u806A \u7948\u7624\u752B \u916A\u7EE2\u6EDA\u526F \u8001\u7BEE \u7EDD\u9611 \u82AD\u4FCA\u5938. \u5DE2\u6D45\u5305\u4FC3\u5E9C\u4FCA \u4E50\u7EF0 \u5DE2\u6D45\u5305\u7248\u539A1\u4E1B\u818A \u5088\u5D14\u79E6\u6797\u6280\u5938."
  },
  answer = {
