    "ANSWER_YES:\u7A8D\u7A8D\u7A8D. \u7948\u7624\u752B \u9694\u8D30 \u710A\u7EF0 \u5DF4\u7BEE \u7281\u56FA\u4E50\u7EF0 \u8001\u6D9D\u806A\u4FC3.",
